import React, { Fragment } from "react";

const SideBox = () => {
  return (
    <div>
      <div className="sidebox-container">
        <div className="name-container">
          <h1>
            Dimitri
            <strong> Michel</strong>
          </h1>
        </div>
        <div className="title-container">Software Developer</div>
      </div>
    </div>
  );
};

export default SideBox;
